<img data-visualcompletion="media-vc-image" alt="May be an image of 1 person and smiling" class="x1bwycvy x193iq5w x4fas0m x19kjcj4" referrerpolicy="origin-when-cross-origin" src="https://scontent.fcai20-4.fna.fbcdn.net/v/t39.30808-6/366546367_3398699837056971_1173453459821253054_n.jpg?stp=cp6_dst-jpg&amp;_nc_cat=111&amp;ccb=1-7&amp;_nc_sid=09cbfe&amp;_nc_ohc=bLcQ01EkK2cAX9lAcRV&amp;_nc_ht=scontent.fcai20-4.fna&amp;oh=00_AfBLAgyf5yxbegjideI3dwGsVIc8bEPoHa3YswnfXcO7Nw&amp;oe=64EA1AE4" width={100} className='rounded-circle' />   
 <div className='bg-warning p-2 rounded d-flex justify-content-between'
    style={{
        width:'200px'
    }}>
    <span className='text-light'>{x.name}</span>
    <span>S</span>
    </div>
    </li> 
  </>
  ))
    }
